import React, { useState } from 'react';
import { Button, Container, Grid, IconButton, Drawer } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';
import logo from '../../assets/image1.png';
import message from '../../assets/contact.png';
import { Link } from 'react-scroll';

const Navbar = () => {
    const [mobileOpen, setMobileOpen] = useState(false);

    const links = [
        { label: "Home", to: "home" },
        { label: "About", to: "about" },
        { label: "Experience", to: "Experience" },
        { label: "Projects", to: "Projects" },
    ];

    return (
        <div style={{ background: "rgb(30,30,30)", color: "white" }}>
            {/* <Container> */}
            <Grid
                container
                alignItems="center"
                justifyContent="space-between"
                px="40px"
                py='20px'
                sx={{ position: 'sticky', top: 0, }}
            >
                {/* Left Logo */}
                <Grid item xs={6} md={2}>
                    <img src={logo} alt="logo" style={{ height: '60px', cursor: 'pointer' }} />
                </Grid>

                {/* Desktop Nav Links */}
                <Grid
                    item
                    xs={0}
                    md={7}
                    sx={{ display: { xs: 'none', md: 'flex' }, justifyContent: 'center', gap: 3 }}
                >
                    {links.map((link) => (
                        <Button
                            key={link.to}
                            sx={{ color: 'white', textTransform: 'none', fontWeight: 'bold' }}
                        >
                            <Link to={link.to} smooth={true} duration={500}>
                                {link.label}
                            </Link>
                        </Button>
                    ))}
                </Grid>

                {/* Right Contact Button (Desktop) */}
                <Grid
                    item
                    xs={0}
                    md={3}
                    sx={{ display: { xs: 'none', md: 'flex' }, justifyContent: 'flex-end' }}
                >
                    <Button
                        variant="contained"
                        sx={{
                            background: 'white',
                            color: 'black',
                            fontWeight: 'bold',
                            display: 'flex',
                            alignItems: 'center',
                            gap: 1.5,
                            textTransform: 'none',
                            padding: '6px 16px',
                        }}
                    >
                        <img src={message} alt="message icon" style={{ width: 20, height: 20 }} />
                        Contact Me
                    </Button>
                </Grid>

                {/* Mobile Menu Icon */}
                <Grid item xs={6} md={0} sx={{ display: { xs: 'flex', md: 'none' }, justifyContent: 'flex-end' }}>
                    <IconButton onClick={() => setMobileOpen(true)} sx={{ color: "white" }}>
                        <MenuIcon />
                    </IconButton>
                </Grid>
            </Grid>


            {/* Mobile Drawer */}
            <Drawer
                anchor="right"
                open={mobileOpen}
                onClose={() => setMobileOpen(false)}
                PaperProps={{
                    sx: { width: 250, backgroundColor: "rgb(30,30,30)", color: "white" }
                }}
            >
                <IconButton onClick={() => setMobileOpen(false)} sx={{ color: "white", alignSelf: "flex-end", m: 1 }}>
                    <CloseIcon />
                </IconButton>

                {/* Mobile Nav Links */}
                {links.map((link) => (
                    <Button
                        key={link.to}
                        sx={{
                            color: 'white',
                            textTransform: 'none',
                            fontWeight: 'bold',
                            width: '100%',
                            justifyContent: 'flex-start',
                            padding: '10px 16px'
                        }}
                        onClick={() => setMobileOpen(false)}
                    >
                        <Link to={link.to} smooth={true} duration={500}>
                            {link.label}
                        </Link>
                    </Button>
                ))}

                <Button
                    variant="contained"
                    sx={{
                        background: 'white',
                        color: 'black',
                        fontWeight: 'bold',
                        display: 'flex',
                        alignItems: 'center',
                        gap: 1.5,
                        textTransform: 'none',
                        padding: '6px 16px',
                        width: "100%",
                        mt: 2
                    }}
                >
                    <img src={message} alt="message icon" style={{ width: 20, height: 20 }} />
                    Contact Now
                </Button>

            </Drawer>
            {/* </Container> */}
        </div >
    );
};

export default Navbar;
